%script

drop table
    OML_TRANSACTIONS_WA1;

%script

create table 
    OML_CLUSTERING_SET_WA1 (setting_name  varchar2(100), setting_value varchar2(4000));

%script

drop table
    OML_CLUSTERING_SET_WA1;

%script

begin       

    insert into OML_CLUSTERING_SET_WA1 (setting_name, setting_value) 
        values (dbms_data_mining.prep_auto, dbms_data_mining.prep_auto_on);

    insert into OML_CLUSTERING_SET_WA1 (setting_name, setting_value) 
        values (dbms_data_mining.kmns_distance, dbms_data_mining.kmns_euclidean);

    insert into OML_CLUSTERING_SET_WA1 (setting_name, setting_value) 
        values (dbms_data_mining.clus_num_clusters, 9);

end;

%script

begin

dbms_data_mining.CREATE_MODEL(
    model_name          => 'OML_CLUSTERING_MOD_WA1',
    mining_function     => dbms_data_mining.clustering,
    data_table_name     => 'OML_TRANSACTIONS_WA1',
    case_id_column_name => 'ID',
    settings_table_name => 'OML_CLUSTERING_SET_WA1'
    );

end;

%script

begin

dbms_data_mining.DROP_MODEL(
    model_name        => 'OML_CLUSTERING_MOD_WA1'
    );

end;

%script

drop table
    OML_CLUSTERING_APP_WA1;

%script

drop table
    OML_CLUSTERING_PRD_WA1;

%script

drop table
    OML_CLUSTERING_RES_WA1;

